'use strict';
var tools = require('./tools');

module.exports = {
  'image_width': tools['image-width'],
  'image-width': tools['image-width'],
  'image_height': tools['image-height'],
  'image-height': tools['image-height'],
  'inline-image': tools['inline-image']
};
